import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <app-navbar></app-navbar>
    <main>
      <router-outlet></router-outlet>
    </main>
  `,
  styles: [`
    main {
      min-height: calc(100vh - 70px);
      padding-top: 70px;
    }
  `]
})
export class AppComponent {
  title = 'HealthyFood';
}
